$(document).ready(()=>{uploadHelper.init()});let uploadHelper={init:()=>{uploadHelper._fileUploadUrl=$("#file-upload-form").attr("upload-file-action"),$("#file-upload-button").click(()=>{let i=$("#file-upload-input")[0],n=new FormData,t=i.files;if(t.length!==0){$(t).each((t,i)=>{n.append("file",i,i.name)});let r=$("#override-existing").is(":checked");n.append("overrideExisting",r);$.ajax({url:uploadHelper._fileUploadUrl,type:"POST",data:n,success:n=>{if(n.isFail){alert("Ошибка при загрузке файлов: "+n.message);return}progressBarHelper.startMonitoring()},cache:!1,contentType:!1,processData:!1})}})},_fileUploadUrl:""};